import './App.css';

const App = () => (
  <div className="App">
    <div className="gradient__bg">
      <Navbar />
      <Header />
    </div>
    <Brand />
    <Application />
    <br></br>
    <WhatVGA />
    <Features />
    
    {/* <Team /> */}
    <Blog />
    <Footer />
  </div>
);

export default App;
